!async function(){const t=document.getElementById("view-counter");if(t){const n=await fetch("https://us-central1-ut-dts-agrc-gis-utah-gov-prod.cloudfunctions.net/viewcounter",{method:"POST",body:`${location.origin}${location.pathname}`});if(200===n.status){const o=await n.json();o.hasOwnProperty("skip")&&o.skip||(t.innerHTML=`This page has been viewed ${o.count.toLocaleString()} times`)}}}();